void yywarn(char *s)
{
    *gProject->Parse_TOS->yyerrstream
         << gProject->Parse_TOS->filename << ":" << gProject->Parse_TOS->yylineno
         << ": Warning - " << s << ":\n" << gProject->Parse_TOS->line;
    print_caret(gProject->Parse_TOS->line, gProject->Parse_TOS->yycolno);
}

